import './App.css';
import Home from './components/Home'
import Countdown from './components/Countdown'
import RSVP from './components/RSVP'
import Info from './components/Ceremony'
import Footer from './components/Footer'

function App() {
  return (
    <div className="App">
      <Home/>
      <Countdown/>
      <Info/>
      <RSVP/>
      <Footer/>
    </div>
  );
}

export default App;
